import React from "react";
import Transaction from "./Transaction";

function TransactionsList({transactionsArray}) {
  const transactions = transactionsArray.map((transaction)=> {
    return <Transaction 
    key={transaction.id} 
    transaction={transaction}
    />
  }
  );
  return (
    <table className="table table-bordered border-primary">
    <tbody>
     <tr>
     <th>
        <h3 className="ui center header blue">Date</h3>
     </th>
     <th>
        <h3 className="ui center header blue">Description</h3>
     </th>
     <th>
        <h3 className="ui center header blue">Category</h3>
     </th>
     <th>
        <h3 className="ui center header blue">Amount</h3>
     </th>
     </tr>
     {transactions}
    </tbody>
  </table>
  );
}


export default TransactionsList;
